tables.table_schema:
CREATE TABLE patient_outcomes (
  patient_id INT PRIMARY KEY,
  surgery_date DATE,
  recovery_duration INT,
  outcome_description TEXT
);

CREATE TABLE patient_outcomes (
  patient_id INT PRIMARY KEY,
  surgery_date DATE,
  robot_model VARCHAR,
  recovery_rate FLOAT
);

CREATE TABLE recovery_notes (
  note_id INT PRIMARY KEY,
  patient_id INT REFERENCES patient_outcomes(patient_id),
  note_text TEXT,
  doctor_notes TEXT
);

CREATE TABLE surgery_procedures (
  procedure_id INT PRIMARY KEY,
  patient_id INT REFERENCES patient_outcomes(patient_id),
  procedure_name VARCHAR,
  procedure_date DATE
);
